import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsxRuntime classic */
/* @jsx mdx */
import SEO from '../components/SEO'


const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <script src='https://identity.netlify.com/v1/netlify-identity-widget.js'></script>
    <SEO description='Learn more about me' title='About' mdxType="SEO" />
    <img src='/muhammad-pbuh.jpg' alt='Muhammad (peace be upon him) was beautiful, inside out' className='max-h-screen w-2/5 m-auto' />
    <p className='text-center'>
	Muhammad (peace be upon him) was beautiful // Art by{' '}
	<a href='https://www.behance.net/kmrghani'>Kareem Mrghani</a>
    </p>
    <h1>{`Hi there 👋`}</h1>
    <p>{`I'm Nabil Tharwat, a software engineer, content creator, and mentor based in Cairo, Egypt. I started coding when I was 12 with VB, and now
living in JS land. I love contributing to open source and lifting others up. Accessibility and performance are part of my eternal quest.`}</p>
    <h3>{`Get in touch`}</h3>
    <p><a parentName="p" {...{
        "href": "mailto:nabil.tharwat@outlook.com"
      }}>{`Email`}</a>{` and `}<a parentName="p" {...{
        "href": "https://twitter.com/Nabil_Tharwat16"
      }}>{`Twitter`}</a>{` are your best channels. You can also find me on `}<a parentName="p" {...{
        "href": "https://www.linkedin.com/in/i-am-nabil"
      }}>{`LinkedIn`}</a>{` and `}<a parentName="p" {...{
        "href": "https://github.com/KL13NT"
      }}>{`GitHub`}</a>{`. I also have a YouTube `}<a parentName="p" {...{
        "href": "https://www.youtube.com/channel/ucdgkzbiqkepzsqff7hbrspg"
      }}>{`channel`}</a>{`.`}</p>
    <h3>{`Aside from work`}</h3>
    <p>{`When I'm not coding some frontend stuff I'm usually found experimenting, mentoring people new to the field, trying out new utilities on the market, blogging, going live, making videos and devlogs, or contributing to Valarium.`}</p>
    <p>{`I love environments that help me grow. Team members who know how to communicate their thoughts well are appreciated. I love making a difference with my code.`}</p>
    <p className='text-center mt-12'>
	Made with
	<span aria-label='Heart emoji' role='img'>
		{' '}
		❤️{' '}
	</span>
	and Gatsby
    </p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
